The Kings Exhibition @thekingsexhibition and Fulton County Arts & Culture in association with Fulton Films & The Atlanta  Film Society Presents The 50th Anniversary of Hip Hop Festival 

Come join us for a legendary celebration of the 50th Anniversary of the Hip Hop Film Festival! Get ready to immerse yourself in the rich history and vibrant culture of hip hop through an exciting lineup of films, performances, and interactive experiences.

Date: Sat Sep 30 2023
Time: 10:00 AM - 10:00pm

The Tara Theater 
Location: 2345 Cheshire Bridge Road Northeast, Atlanta, GA 30324

Prepare to be blown away by a diverse range of films that showcase the evolution of hip hop over the past five decades.

